import React from 'react'

function fetchWeather(country, apiKey) {
  fetch(`https://api.openweathermap.org/data/2.5/weather?q=${country}&appid=${apiKey}`)
      .then(response => response.json())
      .then(data => {
          console.log(data); // Log the weather data to the console
      })
      .catch(error => {
          console.error('Error fetching weather data:', error);
      });
}
function WeatherComponent() {
  fetchWeather('London', 'baafed74ddd9f05c52673a3bd435bb33'); 
}
const Three = () => {
  return (
    <div className='p-4 m-4 bg-blue-300'>
 {WeatherComponent()}
    </div>
  )
}

export default Three
